BEGIN;
INSERT INTO `bms_post` (`id`, `title`, `content`, `user_id`, `comments`, `collects`, `view`, `top`, `essence`, `section_id`, `create_time`, `modify_time`) VALUES ('1668957226213060610', 'test', 'test\n\n', '1668944443979345922', 0, 0, 3, b'0', b'0', 0, '2023-06-14 20:23:05', NULL);
INSERT INTO `bms_post` (`id`, `title`, `content`, `user_id`, `comments`, `collects`, `view`, `top`, `essence`, `section_id`, `create_time`, `modify_time`) VALUES ('1670297608385495042', '关于jdbc连接mysql URL上的常见问题', '# 关于jdbc连接mysql URL上的常见问题\n\n## 编码问题\n\n**在url ?的后面添加如下参数：**\n\n```xml\nuseUnicode=true&amp;characterEncoding=UTF-8\n```\n\n## 时区问题\n\n**在url ? 的后面添加如下参数**\n\n```\nserverTimezone=UTC\n```\n\n```\nserverTimezone=Asia/Shanghai\n```\n\n**使用上海的时区，也可以使用Hongkong的时区**\n\n**具体时区可以去/usr/share/zoneinfo里查询。**\n\n```\nserverTimezone=GMT%2B8\n```\n\n**表示设置MySQL服务器的时区为GMT+8，即东八区。**\n\n## 零值日期\n\n**在url ? 的后面添加如下的参数，会把零值日期转换为 null 值。**\n\n```\nzeroDateTimeBehavior = convertToNull\n```\n\n## 密钥问题\n\n**在url ? 的后面添加如下的参数，允许从服务器检索公钥以进行密码验证。**\n\n```\nallowPublicKeyRetrieval=true\n```\n\n## SSL协议问题\n\n**在url ? 的后面添加如下的参数，表示不使用SSL协议进行加密连接。**\n\n```\nuseSSL=false\n```\n\n##### *注意：参数间使用 & 连接*\n\n', '1668944443979345922', 0, 0, 6, b'0', b'0', 0, '2023-06-18 13:09:17', '2023-06-18 13:14:50');
INSERT INTO `bms_post` (`id`, `title`, `content`, `user_id`, `comments`, `collects`, `view`, `top`, `essence`, `section_id`, `create_time`, `modify_time`) VALUES ('1668957078498062337', '测试', '测试\n\n', '1349290158897311745', 0, 0, 2, b'0', b'0', 0, '2023-06-14 20:22:30', NULL);
COMMIT;

