) ENGINE=InnoDB AUTO_INCREMENT=24865 DEFAULT CHARSET=utf8mb3 ROW_FORMAT=DYNAMIC COMMENT='每日赠言';

-- ----------------------------
-- Records of bms_tip
-- ----------------------------
BEGIN;
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (1, '一代锤子一代皇，代代锤子教做人！', '斗罗大陆', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (2, '你指尖跳动的电光，是我此生不变的信仰', '某科学的超电磁炮', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (3, '军人天生就舍弃了战斗的意义！', '谚语', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (4, '所谓觉悟，乃是在漆黑的荒原中，开辟出一条属于自己的星光大道！', '乔鲁诺 · 乔巴拿', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (5, '我不努力，就见不到你了啊。', '野中晴', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (6, '失去故土的花朵，回不去，却也离不开。', '夏达', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (7, '千万丈的大厦总要有片奠基石，最初的爱好无可替代。', '王小波', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (8, '祈愿万家灯火熨烫过脉络，刀山与火海多深刻，都陪你渡过。', '南语', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (9, '我只能送你到这里了，剩下的路你要自己走，不要回头。', '白龙', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (10, '真正的朋友应该说真话，不管那话多么尖锐。', '奥斯特洛夫斯基', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (11, '时间是一切财富中最宝贵的财富。', '德奥弗拉斯多', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (12, '也许是把一些事物看太重了，然而失去了才患于恋恋不舍。', '朴素', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (13, '如果有一个喜欢你的人出现，一定不要凶她哦！', '次元战争·红龙', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (14, '为你而战，我的女士！', '血色指挥官莫格莱尼', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (15, '希望是坚韧的拐杖，忍耐是旅行袋，携带它们，人可以登上永恒之旅。', '罗素', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (18, '未经审视的人生是不值得过的。', '苏格拉底', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (19, '我们现在必须完全保持党的纪律，否则一切都会陷入污泥中。', '马克思', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (20, '在科学上没有平坦的大道，只有不畏劳苦沿着陡峭山路攀登的人，才有希望达到光辉的顶点。', '马克思', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (21, '我终不能改变那个开始，何不忘了那个结局呢。', '悟空传', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (22, '人生当中成功只是一时的，失败却是主旋律。但是如何面对失败，却把人分成了不同的样子。有的人会被失败击垮，有的人能够不断地爬起来继续向前。澳大利亚队是如此的，西班牙队也是如此。我想真正的成熟并不是追求完美，而是直面自己的缺憾，这才是生活的本质。', '贺炜', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (23, '罗曼-罗兰说过的，这个世上只有一种真正的英雄主义，那就是认清生活的真相，并且仍然热爱它。西班牙队重头再来吧，难道向上攀爬的那条路不是比站在顶峰更让人热血澎湃吗？', '贺炜', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (24, '阿根廷诗人博尔赫斯曾说，任何命运，无论如何漫长复杂，实际上只反映于一个瞬间：人们大彻大悟自己究竟是谁的瞬间。', '贺炜', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (25, '梅西一定经历过低谷，彷徨质疑和挣扎，我们还记得3079天以前梅西也陷落在人生的低谷里。在巴西世界杯决赛中，梅西率领的球队在加时赛中输给了德国，距离大力神杯只有一步之遥，但今天他率领了他的小伙子们，为阿根廷赢回了36年之后的又一个世界杯冠军，梅西挺了过来，阿根廷挺了过来。', '贺炜', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (26, '36年的时间，上一次获得世界杯冠军的时候马拉多纳还是他们的10号，10号现在传承给了梅西。梅西不需要用另一个冠军来证明自己，但是阿根廷需要。', '贺炜', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (27, '胜负既分，结局也已经确定了，英格兰和德国永恒的对抗在世界杯历史上继续延续下去，历史的篇章这一段已经写完。我们想想吧，此时此刻在柏林、在慕尼黑、在汉堡、在科隆大教堂，肯定有无数的德国球迷为之欢欣鼓舞。而在伦敦、在利物浦、在曼彻斯特、在泰晤士河边的小酒馆，肯定有无数的英格兰球迷为之黯然神伤。   ', '贺炜', 1);
INSERT INTO `bms_tip` (`id`, `content`, `author`, `type`) VALUES (28, '请不要相信，胜利就像山坡上的蒲公英一样唾手可得，但是请相信，世界上总有一些美好值得我们全力以赴，哪怕粉身碎骨。', '贺炜', 1);
COMMIT;

-- ----------------------------
-- Table structure for oa_process
-- ----------------------------
DROP TABLE IF EXISTS `oa_process`;
CREATE TABLE `oa_process` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'id',
  `process_code` varchar(50) NOT NULL DEFAULT '' COMMENT '审批code',
  `user_id` bigint NOT NULL DEFAULT '0' COMMENT '用户id',
  `process_template_id` bigint DEFAULT NULL COMMENT '审批模板id',
  `process_type_id` bigint DEFAULT NULL COMMENT '审批类型id',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `form_values` text COMMENT '表单值',
  `process_instance_id` varchar(255) DEFAULT NULL COMMENT '流程实例id',
  `current_auditor` varchar(255) DEFAULT NULL COMMENT '当前审批人',
  `status` tinyint DEFAULT NULL COMMENT '状态（0：默认 1：审批中 2：审批通过 -1：驳回）',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` tinyint NOT NULL DEFAULT '0' COMMENT '删除标记（0:不可用 1:可用）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3 COMMENT='审批类型';

